import React from 'react'
import styled from 'styled-components'



const CartSection = styled.div`
    display: flex;
    margin-top: -9px;
      border-radius: 10px;
      padding: 20px;
      padding-top: 20px;
      border: 1;

`;
const CartWrapper = styled.div`



`;

const CartImage = styled.img`

object-fit: fill;
    min-width: 300px;
    min-height: 200px;
    width: 20%;
`;
const CartContent = styled.div`


      h2{
        font-size: 18px;
      font-weight: 600;
      }
      p{
        font-size: 14px;
      font-weight: 300;
      margin-top: 8px;
      margin-bottom: 8px;
      }
`;



const Cart = ({ image, alt, title, price }) => {
    return (
        <CartSection>

                <CartContent>
                    <CartImage src={image} alt={alt} />
                    <h2>{title}</h2>
                    <p>{price}</p>
                </CartContent>


        </CartSection>

    )
}

export default Cart
